import{_ as t,c as o,o as r,ah as s}from"./chunks/framework.PvdZnrZd.js";const u=JSON.parse('{"title":"SHOPIFY PRESTASHOP CONNECTOR","description":"SHOPIFY PRESTASHOP CONNECTOR","frontmatter":{"title":"SHOPIFY PRESTASHOP CONNECTOR","description":"SHOPIFY PRESTASHOP CONNECTOR","date":"2025-07-20T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/connector/shopify-prestashop-connector.md","filePath":"zenith/featured-app/connector/shopify-prestashop-connector.md"}'),n={name:"zenith/featured-app/connector/shopify-prestashop-connector.md"};function a(l,e,p,i,h,c){return r(),o("div",null,[...e[0]||(e[0]=[s('<p><a href="/zenith/introduction/overview.html">Multivendor Marketplace</a> App for Shopify is here with yet another connector. This time it&#39;s for the sellers having stores on Prestashop!</p><p>If the sellers register on admin&#39;s marketplace have their stores on Prestashop and they want to connect their stores with admin&#39;s store then,</p><p>this can be achieve using <strong>PrestaShop Connector</strong> Feature App.</p><p>With Shopify-Prestashop Connector, You as a Store Owner can allow your sellers to import their products from Prestashop to admin&#39;s Shopify store.</p><p>To make this feature work, Seller needs to install a <strong>Module</strong> on Prestashop. Both admin &amp; seller can download the Module from Multivendor App.</p><p>After installing the module, Products created on PrestaShop will be auto-update on Shopify while the pre-existing products will be imported within the app.</p><p>Once the customer orders any imported products on Shopify, the same order will create on Prestashop. And if an order is created on PrestaShop, inventory will be updated on Shopify.</p><p>To install this feature app, the admin needs to visit the &quot;Feature App&quot; section and approve the charge of $25 USD in addition to the Multivendor App plan.</p><h2 id="features" tabindex="-1">Features <a class="header-anchor" href="#features" aria-label="Permalink to &quot;Features&quot;">​</a></h2><ul><li>Admin can allow his sellers to connect their Prestashop store with admin&#39;s Store.</li><li>Sellers can import the products by Product IDs from their Prestashop store to admin&#39;s marketplace</li><li>Moreover, seller needs to map their Prestashop store&#39;s Collection with admin&#39;s Store&#39;s collection.</li><li>the seller can easily enable the auto-sync for the new products.</li><li>Also, Seller can map product type &amp; product tags of Prestashop with admin&#39;s Store.</li><li>When imported product will be ordered on Shopify, the same order will be created on Prestashop.</li><li>When imported product will be ordered on Prestashop, inventory will updatevon Shopify.</li><li>Once a product is created at PrestaShop, the same will be updated automatically on Shopify as well.</li><li><strong><a href="/zenith/featured-app/marketplace-product-add-ons/slot-pricing.html">Slot Pricing</a> is compatible</strong> with this connector.</li><li>Both admin &amp; seller can now sync the seller’s products in any state from the “Product Listing” section of their respective panels.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/11/Product-Admin-2-1200x597.png" alt="abc"></p><h2 id="limitations" tabindex="-1">Limitations <a class="header-anchor" href="#limitations" aria-label="Permalink to &quot;Limitations&quot;">​</a></h2><ul><li>Sellers can import only Standard Products from PrestaShop to Shopify.<br> -<strong>Simple Product</strong><br> -<strong>Product with Combinations</strong></li><li>Admin can import a maximum of 250 Products at once from PrestaShop to Shopify.</li><li>Variations should be less than OR equal to 100.</li><li>Also, Option name should be less than OR equal to 3.</li><li>It is mandatory to enable the visibility of the product available for order on PrestaShop.</li><li>Tax &amp; Discounts <strong>can&#39;t be manage</strong> on Orders. Thus, the order amount at PrestaShop may differ from the actual order amount visible to the seller on the Multivendor App.</li><li>The default currency set on admin&#39;s Shopify store and seller&#39;s PrestaShop <strong>should be the same</strong>.</li><li>It is mandatory to enable &quot;Guest Checkout&quot; on PrestaShop as customers purchasing imported products on the store will add as &quot;Guest&quot; on PrestaShop.</li></ul><p><strong>Note:-</strong> Suppose a country (where the seller has to ship the order) is disabled from the Countries section of seller&#39;s PrestaShop store.<strong>(International&gt;&gt;Locations&gt;&gt;Countries)</strong>.</p><p>Then, in this case, the order will not be placed on PrestaShop if the customer has select the Shipping address of that particular country.</p><p>Seller needs to enable the countries again:-</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/11091820/AwesomeScreenshot-Countries-FoodKart-2019-07-11-14-07-71.png" alt="Prestashop-Locations"></p><p><strong>Important Note:-</strong><br> This connector is compatible with <strong>Prestashop 1.7.4 and Prestashop 1.7.5</strong></p><p>To make it work with all the supported versions, it is mandatory to add the codes.  <strong><a href="https://github.com/PrestaShop/PrestaShop/pull/11902/files" target="_blank" rel="noreferrer">Click here</a></strong> and <strong>follow the suggested path</strong> to add the codes.</p><p>This procedure is the same for all the versions.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Screenshot-15.png" alt="PrestaShop Code Pasting"></p><p>If You get any issue in order or product updates, please make sure that you have added the above codes.</p><h2 id="permissions-required-in-prestashop-for-sellers" tabindex="-1">Permissions Required In PrestaShop For Sellers <a class="header-anchor" href="#permissions-required-in-prestashop-for-sellers" aria-label="Permalink to &quot;Permissions Required In PrestaShop For Sellers&quot;">​</a></h2><p>The seller needs to allow certain permissions on PrestaShop. Allow the following <strong>webservices permissions</strong>:-</p><p>products<br> images<br> configurations<br> stock_availables<br> combinations<br> product_options<br> product_option_values<br> categories</p><p>tags<br> shops<br> currencies<br> countries<br> states<br> address<br> customers<br> carriers<br> cart_carrier_price<br> cart_rules<br> carts<br> orders<br> order_carriers<br> order_histories</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2021/06/screenshot-nimbusweb.me-2021.06.23-18_35_40-1200x549.png" alt="required permissions"></p><h2 id="how-to-install" tabindex="-1">How to Install <a class="header-anchor" href="#how-to-install" aria-label="Permalink to &quot;How to Install&quot;">​</a></h2><p>Admin can follow below-given steps to install the Shopify-Prestashop Connector App:</p><p><strong>Step 1:</strong> Visit the <strong>Feature Apps</strong> Section.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Dashboard-Admin-1-1.png" alt="Shopify-Prestashop 1"></p><p><strong>2nd Step:</strong> Filter the Category by &quot;<strong>Connector</strong>&quot; and find the <strong>Shopify PrestaShop Connector</strong> Feature App and Click on the <strong>Enable</strong> button.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Screenshot-6-2.png" alt="Shopify-Prestashop Connector 2"></p><p><strong>Step 3:</strong> Click on the &quot;<strong>Agree</strong>&quot; button and proceed further to <strong>Approve</strong> the Charge.</p><p>This way, admin can install the Shopify-Prestashop Connector Feature App.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Instructions-Admin-2.png" alt="Instruction"></p><p>As soon as you install the Shopify-Prestashop feature app, You need to share a <strong>Delivery URL,</strong> <strong>SID</strong> and a <strong>Prestashop Module</strong> with your sellers.</p><p>Go to the “Instruction for Marketplace” section of the Multivendor app &amp; get the URL and download the module from there.</p><h2 id="product-detail-configuration" tabindex="-1">PRODUCT DETAIL CONFIGURATION <a class="header-anchor" href="#product-detail-configuration" aria-label="Permalink to &quot;PRODUCT DETAIL CONFIGURATION&quot;">​</a></h2><p>Now, admin needs to select the PrestaShop connector from the &quot;Connector Configuration&quot; menu of the app.</p><p>Go to Configuration&gt;&gt;Select the Prestashop Connector&gt;&gt;Product Detail Configuration.</p><p>Now, he can enable/disable other tabs for this section as well.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/screenshot_1708952412908-653x1024.png" alt="Connector configuration"></p><h2 id="image-limiter" tabindex="-1">Image Limiter <a class="header-anchor" href="#image-limiter" aria-label="Permalink to &quot;Image Limiter&quot;">​</a></h2><p>The admin has the ability to enable a configuration that restricts the number of product images to a range of 1 to 20.</p><p>This ensures that sellers can only synchronize a specific number of images, as defined by the admin.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/07/screenshot_1688648237530-1-1200x457.png" alt="screenshot_1688648237530-1"></p><p>This feature allows for better control over the number of images associated with each product, providing a more streamlined and consistent experience for both sellers and customers.</p><h2 id="sync-customer-details" tabindex="-1">Sync Customer Details <a class="header-anchor" href="#sync-customer-details" aria-label="Permalink to &quot;Sync Customer Details&quot;">​</a></h2><p>By enabling this tab, you can sync customer details in order with the seller’s PrestaShop store. Let’s understand this feature with two cases.</p><p><strong>CASE 1: Sync Customer Details tab is ON (enabled):</strong></p><p>Once a customer places an order, the customer will be created on the seller’s PrestaShop store with complete shipping.</p><p>Also, the customers will receive an email from the seller’s store regarding the same.</p><p>NOTE:- In this case, if you don’t want to send an email to the customer, you can configure a dummy email.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/09/onn-1-1200x572.webp" alt="on"></p><p><strong>CASE 2: Sync Customer Details tab is OFF (disabled):</strong></p><p>In case you disable this tab, you will get three options to choose whether you want to sync the customer’s <strong>shipping address, name,</strong> and <strong>email</strong> or not.</p><p>You can configure the settings as per the requirements with Seller’s PrestaShop store or not.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/09/off-1-1200x578.webp" alt="off"></p><p><strong>Note:-</strong> Once the order is created at the admin Shopify store for the connector product then the same order will be created on seller&#39;s Prestashop store also.</p><p>Even, the admin will get a reference order number like below that will be shown the order section of the seller&#39;s Prestashop store.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2023/02/screenshot_from_2022_12_27_12_51_33-4-1200x595.png" alt="reference order number"></p><h2 id="how-the-seller-will-install-the-module-on-prestashop" tabindex="-1">How the Seller will install the Module on PrestaShop? <a class="header-anchor" href="#how-the-seller-will-install-the-module-on-prestashop" aria-label="Permalink to &quot;How the Seller will install the Module on PrestaShop?&quot;">​</a></h2><p>Once the admin provides the PrestaShop Module to the sellers, seller can upload the module on PrestaShop and configure its details to make the feature work.</p><p>Steps to Upload the Module:</p><ul><li>Seller will log in to PrestaShop.</li><li>Go to Modules.</li><li>Visit the Module Catalog and Click on &quot;<strong>Install a Module</strong>&quot;.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Module-Catalog-%E2%80%A2-Shashi-store1.png" alt="PrestaShop11"></p><ul><li>Upload the Module and Configure it.</li><li>Go to <strong>Module Manager</strong> to configure the Module.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Module-manager-%E2%80%A2-Shashi-store1.png" alt="module22"></p><ul><li>Seller needs to enter the Source URL and SID provided by the admin.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Module-Manager-%E2%80%A2-Shashi-store1.png" alt="Configure Module"></p><p>This way, a seller can install the module on his/her PrestaShop and configure it following the given instruction.</p><p>As soon as the seller installs the module, the products created at PrestaShop will be auto-updated on Shopify. Seller needs to import the existing products from the app.</p><h2 id="how-to-generate-access-token" tabindex="-1">How to Generate Access Token? <a class="header-anchor" href="#how-to-generate-access-token" aria-label="Permalink to &quot;How to Generate Access Token?&quot;">​</a></h2><p>To generate access token on PrestaShop, Seller needs to follow certain steps that are as follows:</p><ul><li><strong>Login</strong> to PrestaShop.</li><li>Search to <strong>Configure</strong>.</li><li>Go to <strong>Advanced Parameters</strong>.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Dashboard-%E2%80%A2-Shashi-store1.png" alt="PrestaShop 10"></p><ul><li>Click on <strong>Webservice</strong>.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Dashboard-%E2%80%A2-Shashi-store1-1.png" alt="Webservice"></p><ul><li>Click on “<strong>Add new Webservice Key</strong>“.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Screenshot-12-2.png" alt="Access"></p><ul><li>Now, Click on “<strong>Generate</strong>” button &amp; assign all the permissions.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Webservice-Add-new-%E2%80%A2-Shashi-store1-2.png" alt="Access 12"></p><ul><li>This way, you can generate the access token to make this feature work.</li></ul><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Webservice-%E2%80%A2-Shashi-store1-png-1286%C3%97657-.png" alt="prestaShop webservice2"></p><p><strong>Note:-</strong> Once the Seller installs any module for the first time on his/her PrestaShop,</p><p>Make sure that the Seller has enabled the <strong>“PrestaShop Webservice”</strong> from the Configuration section (as shown in above screenshot).</p><h2 id="prestashop-configuration" tabindex="-1">PrestaShop Configuration <a class="header-anchor" href="#prestashop-configuration" aria-label="Permalink to &quot;PrestaShop Configuration&quot;">​</a></h2><p><strong>SELLER END</strong></p><p>Once the admin installs the app, he/she will get a new sub-menu in the Configuration menu of the Seller Panel. Seller needs to configure the PrestaShop details from this section of the app.</p><p><strong>PrestaShop App Configuration:</strong></p><p>-Seller will enter the URL of his/her PrestaShop.<br><strong>Note</strong>:- URL added must be added without the language code.</p><p>-Seller will enter the Weight Unit of PrestaShop.<br> -Seller will enter the Dimension Unit of his/her PrestaShop.<br> -Paste the access token generated from PrestaShop.</p><p>-Seller will enter the Payment Method Name and Payment Method Module of his/her PrestaShop.<br> -Seller can enable the auto-sync for the new products.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/04/vineet-sinha-sh.webkul.com_shopify-mp_index.php_pconnector_configsplatform_id5new-test-1-675x1024.png" alt="Prestashop connector config"></p><p>Sellers can directly download the PrestaShop Module from PrestaShop details section of their seller Panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Screenshot-5-7.png" alt="Module"></p><h2 id="prestashop-payment-details" tabindex="-1">PrestaShop Payment Details <a class="header-anchor" href="#prestashop-payment-details" aria-label="Permalink to &quot;PrestaShop Payment Details&quot;">​</a></h2><p>While configuring PrestaShop details on admin’s store, the seller needs to enter Payment Method Name and Payment Method Module.</p><p>Sellers can get these details from the “Payment” section of his/her PrestaShop store.</p><ul><li>Login to PrestaShop.</li><li>Go to Payment Section.</li><li>Click Payment Methods.</li><li>Choose any of the active payment methods.</li><li>Click on it and get the Payment Method Module from the page.</li></ul><p>For <strong>Payment Method Name</strong>, do refer the below-given screenshot:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Payment-Methods-%E2%80%A2-Shashi-store1.png" alt="Payment Method Name"></p><p>For <strong>Payment Method Module</strong>, do refer the below-given screenshot:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Module-Manager-%E2%80%A2-Shashi-store1-1.png" alt="Payment Method Module"></p><p>By saving the details, Seller will move forward to map Collection, Product Type &amp; Product Tag.</p><p><strong>-Category Mapping</strong><br> From this section, Seller will map admin’s pre-defined Shopify store collections with seller’s PrestaShop Collection.</p><p><strong>Note</strong>:- Make sure that admin has enabled the “Restrict Collection” tab from MV admin panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Screenshot-7-3.png" alt="PrestaShop11"></p><p>Clicking on the Map Collection, the seller will get the option to select collection of admin’s store and map the same with the collections of his/her PrestaShop. This will be a One to Many Mapping.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Screenshot-8-3.png" alt="PrestaShop22"></p><p><strong>-Tag Mapping</strong> <br> Seller will map all the Product’s Tags of admin’s Shopify store with the tags of his/her PrestaShop.</p><p><strong>Note</strong>:- Make sure that admin has enabled the “Restrict Product Tag” tab from MV admin panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Screenshot-9-3.png" alt="Prestashop 33"></p><p>Clicking on the Map Tags button, Seller will enter the product tag created by admin and the tags of his/her PrestaShop to map them with each other. This will be a One to Many Mapping.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Screenshot-10-2.png" alt="PrestaShop 44"></p><p><strong>-Type Mapping</strong><br> Seller will map the product type of admin’s Shopify store with product type of his own PrestaShop store. This will be a One to One Mapping.</p><p><strong>Note</strong>:- Make sure that admin has enabled the “Restrict Product Type” tab from MV admin panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Screenshot-11-2.png" alt="PrestaShop 44"></p><p>Moreover, the seller can enable/disable or delete the mapped Product Tag &amp; Product Type.</p><h2 id="seller-importing-products" tabindex="-1">Seller Importing Products <a class="header-anchor" href="#seller-importing-products" aria-label="Permalink to &quot;Seller Importing Products&quot;">​</a></h2><p>As soon as the Seller Configures the PrestaShop details, Seller will get the option to import his/her PrestaShop’s products to admin’s Shopify Store.</p><p>Clicking on the “Import Product” button added in the seller panel, Seller can import products using any of the three methods.</p><p><strong>Method 1:</strong> By Selecting Duration<br> Using this method, Seller will select the <strong>From &amp; To</strong> date and import the product between the chosen date.</p><p><strong>2nd Method:</strong> By Selecting Product ID<br> Also, Seller will enter comma separated product IDs of his/her PrestaShop store and import them in one go.</p><p><strong>Method 3:</strong> By Selecting Range<br> Using this method, Seller will enter the range of product IDs of his/her PrestaShop and import them at a time.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Import-Product-From-Prestashop-Seller-%E2%80%A2-Multivendor-MarketPlace.png" alt="PrestaShop55"></p><p>This way, Seller can import their PrestaShop Products to admin’s Shopify Store.</p><h2 id="product-listing" tabindex="-1">Product Listing <a class="header-anchor" href="#product-listing" aria-label="Permalink to &quot;Product Listing&quot;">​</a></h2><p>As soon as the Seller imports his PrestaShop products to admin’s marketplace, the imported products will be in “Approval Pending” state at both admin &amp; seller panel.</p><p>You can view the imported products in the “<strong>Product Listing</strong>” section of the admin panel.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Product-Admin-2.png" alt="Product Listing "></p><p>Admin can anytime enable or deny the imported product with a reason.</p><p>Once the admin approves the product, the same will reflect at seller side too.</p><h2 id="orders" tabindex="-1">Orders <a class="header-anchor" href="#orders" aria-label="Permalink to &quot;Orders&quot;">​</a></h2><p>Once an order is placed at the Shopify store for the seller product, then the same order will be created on PrestaShop also.</p><p>Accordingly, inventory will be managed at both the ends i.e. at PrestaShop as well as at Multivendor App.</p><p>Once an order is Shipped on PrestaShop, the same will be fulfilled on Multivendor App.<br> An order delivered on PrestaShop will be updated on Multivendor App.</p><p>If an order is canceled or refunded on Shopify, the order state will be updated on PrestaShop.Accordingly, you can update the inventory manually on PrestaShop.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Screenshot-13-1.png" alt="Seller End"></p><p>Moreover, the same order is here on PrestaShop also.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2018/12/Screenshot-14-1.png" alt="PrestaShop00"></p><h2 id="auto-synced-tracking-number" tabindex="-1">Auto-synced tracking number <a class="header-anchor" href="#auto-synced-tracking-number" aria-label="Permalink to &quot;Auto-synced tracking number&quot;">​</a></h2><p>Now, not only order details but also the tracking information like the tracking number will sync in our Prestashop connector automatically.</p><p>Admin end of order view.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/04/4-2-1200x569.png" alt="4-2"></p><p>Seller end of the order view.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2022/04/3-2-1200x538.png" alt="3-2"></p><h2 id="price-rule" tabindex="-1">Price Rule <a class="header-anchor" href="#price-rule" aria-label="Permalink to &quot;Price Rule&quot;">​</a></h2><p>Let the sellers create price rule to manage product price of their PrestaShop store to merchant’s store.</p><p>Sellers will have a new menu named <strong>Connector Price Rule</strong> in the configuration menu of the app.</p><p>From here, seller can create price rules based on which seller’s product price will be calculated on merchant’s store.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Dashboard-Seller-%E2%80%A2-Multivendor-MarketPlace-1.png" alt="Price rule "></p><p>Furthermore, clicking the <strong>Connector Price Rule</strong>, seller needs to enable “Price Rule” status and select the options as increase/decrease price,</p><p>Price will be changed by a fixed amount or a percentage amount, enter the amount that needs to be changed.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/01/Price-Rule-%E2%80%A2-Multivendor-MarketPlace.png" alt="price rule"></p><p>Enable the checkbox to update already synced product’s price at merchant’s store as per the price rule created.</p><p>This way, sellers can create price rule from their respective seller panels based on which product price of the seller’s store will be calculated at merchant’s store.</p><h2 id="sync-barcode" tabindex="-1">Sync Barcode <a class="header-anchor" href="#sync-barcode" aria-label="Permalink to &quot;Sync Barcode&quot;">​</a></h2><p>Now the admin can allow their sellers to sync the product&#39;s Barcodes (UPC, MPN, GTIN, etc) from their Prestashop store to the Admin&#39;s Shopify store.</p><p>To do this, first Admin needs to enable this Configuration from Admin Panel&gt;&gt; Configuration&gt;&gt; Connector Configuration&gt;&gt;Choose Prestashop Connector&gt;&gt;Enable Product Barcode Option&gt;&gt;Save Changes.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/Admin-panel-connector-1-1200x505.jpeg" alt="Admin-panel-connector-1"></p><p>After this is enabled, the seller can select the Barcode( MPN, GTIN, UPC, etc)</p><p>That he wants to sync with the Barcode field in Admin Shopify by navigating to Seller Panel&gt;&gt; Prestashop Configuration&gt;&gt; Select Barcode&gt;&gt;Save.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/prestashop-seller-panel-1200x567.jpeg" alt="prestashop-seller-panel"></p><h2 id="option-name-mapping" tabindex="-1">Option Name Mapping <a class="header-anchor" href="#option-name-mapping" aria-label="Permalink to &quot;Option Name Mapping&quot;">​</a></h2><p>Now admin can map the Prestashop option names with Shopify option names.</p><p>Admin can do this by navigating to the product listing section in the Admin Panel&gt;&gt;Select the product&gt;&gt;Edit&gt;&gt;Scroll down to the variant details section&gt;&gt; Click on the edit(pencil) icon</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/Prestshop-option-name-mapping-1200x569.jpeg" alt="Prestshop-option-name-mapping"></p><p>the option names can be then mapped with their desired Shopify option names.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2024/02/option-name-mapping-1200x572.jpeg" alt="option-name-mapping"></p><p><strong>The Multi-vendor Marketplace app server IP-</strong></p><p>54.255.33.47</p><p>18.138.8.137</p><p>47.129.250.24</p><p>54.179.1.53</p><p>18.136.7.41</p><p>13.229.6.57</p><p>18.138.9.81</p><p>52.74.127.6</p><p>13.228.91.147</p><p>13.250.79.108</p><p>13.229.100.249</p><p>52.220.12.7</p><p>3.1.34.177</p><h3 id="demo-details" tabindex="-1">Demo Details <a class="header-anchor" href="#demo-details" aria-label="Permalink to &quot;Demo Details&quot;">​</a></h3><p>Moreover, follow the below link to check the demo of PrestaShop Connector app:</p><p><a href="https://multivendor-prestashop-connector.myshopify.com/pages/demo" target="_blank" rel="noreferrer">https://multivendor-prestashop-connector.myshopify.com/pages/demo</a></p>',188)])])}const g=t(n,[["render",a]]);export{u as __pageData,g as default};
